NHS England is looking to procure an evaluation of digital approaches to type 2 Diabetes prevention.

The NHS Diabetes Prevention Programme (NDPP) is a joint initiative with Public Health England (PHE) and Diabetes UK which aims to deliver at large scale services, which identify those at high risk of developing Type 2 diabetes and provide the lifestyle change programmes to reduce their weight and increase physical activity. 

Emerging evidence suggests that digital approaches to diabetes prevention could be effective either alone or as an adjunct to traditional services. NHS England is seeking to procure a large scale in service evaluation of digital products focussed on reducing type 2 diabetes. The evaluation will address the key policy questions that before that need to be understood before commissioning decisions or recommendation could be made.

The Authority has identified 7 local geographies where the Digital Behaviour Change Interventions will be implemented and the requirements of the service are:
 The evaluator will select between 4-6 products from a assured longlist of existing digital products which could be rapidly deployed in a live service testing environment;
 The development of a detailed evaluation design to address a set of pre-determined policy questions; 
 The development of a mobilisation plan to implement digital services in real world settings; 
 The management and assurance of providers of digital services / products during the period of the evaluation; 
 5000 individuals receiving digital diabetes programmes
 Production of management reports based on real time / near real time information relating to the services being evaluated to enable stop / go decisions during the period of the evaluation; 
 Detailed analysis to inform the development of a service specification for a procurement of digital diabetes prevention services.
 Interim and final report(s) 
Further background to the programme is available at https://www.england.nhs.uk/ourwork/qual-clin-lead/diabetes-prevention/

Supply and Installation of 7 T Magnetic Resonance Micro-Imaging Spectrometer
      
      Responses to this tender would only be accepted from suppliers that have been awarded a Framework under the NWUPC HVLE Reference LAB3052 NW - Magnetic Resonance Equipment, Associated Equipment, Accessories, Consumables, Maintenance and Servicing of Equipment - Lot 4 NMR Spectrometers.  If you are not an approved Framework suppliers for the above Lot 4, please do not respond to this tender as your response will not be considered.
      
      The NMR facility in the School of Chemistry, University of Birmingham, is in the possession of a 7 Tesla (300MHz) Oxford super-conducting widebore NMR magnet with microimaging gradient coils and microimaging and diffusion probes.
      
      The University of Birmingham invites tenders for supply of the following equipment: 
      
      A) To fit the existing 300 MHz NMR super-conducting widebore magnet, microimaging (micro2.5) gradient coils and microimaging (micro2.5/WB40) and diffusion (DIFF30) probes:
      o  a 2-channel NMR spectrometer console with appropriate amplifiers, pre-amplifiers, and shims system;
      o Triple-axis 60 A microimaging gradient amplifiers compatible with the exisiting UoB micro2.5 (microimaging) and DIFF30 (diffusion) gradient coils.  
      o temperature control unit capable of maintaining samples at high and low temperatures (highly desirable range: from -40?C to +150?C);
      o workstation and NMR/MRI acquisition software;
      o RF quadrature coils and quad combiner;
      o places on training courses (system maintenance and applications) ;
      o on-site support from the manufacturer's application scientists. 
      
      Please note: this requirement needs to fit an existing Bruker NMR superconducting magnet. Whilst there are references to Bruker in the Specification of Requirements, if alternative suppliers can demonstrate clearly operational and workable compatibility, this will be considered in the evaluation process.

Additional information: For any current tenders please visit - www.in-tendhost.co.uk/universityofbirmingham


